import {BrowserRouter as Router, Switch,Route} from "react-router-dom";

// import FeatureInfo from "./FeatureInfo/FeatureInfo";

function App() {
  return (
    <div>
      <Router>
      <Topbar />
      <div className="container">
      <Sidebar />
      <Switch></Switch>
      <Home />
      {/* <FeatureInfo /> */}


      </div>
      </Router>


    </div>
  );
}

export default App;
